description:
Oceans is een 8-delige BBC- documentaireserie waarin een dapper duikteam op zoek gaat naar de geheimen van de zee. Fantastische beelden worden gecombineerd met verrassende onthullingen over de mysterieuze wereld onder water. Zo leren we de kijker van alles over bijvoorbeeld haaien en hun eigenaardigheden, oude piratenschatten en wat koraalriffen ons kunnen vertellen over klimaatveranderingen. Het team bestaat uit louter experts in diverse vakgebieden, zoals onderwaterarcheologie, geologie, zeebiologie en antropologie. Tot het team behoort ook Philippe Cousteau, milieudeskundige en kleinzoon van de beroemde duiker en filmmaker Jacques Cousteau.

